.Portfolio {
    width: 100%;
    height: 100%;
    position: relative;
}


        //IntroCover 
        .Landing-Intro {
            width: 100%;
            height: 100vh;
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            // opacity: 0;
            z-index: 600;
        }
            .Landing-Intro-Wrap {
                width: 100%;
                height: 100%;
                position: relative;
            }  

                .Landing-IntroSlide {
                    position: absolute;
                    width: 50%;
                    height: 100%;
                    top: 0;
                    bottom: 0;
                    background-color: rgb(240, 240, 240);
                    transition: all;
                    z-index: 1;
                }
                    .Landing-IntroSlideLeft {
                        left: -100%;
                    }

                    .Landing-IntroSlideRight {
                        right: -100%;
                    }


        //Windows
            .WindowWrap {
                width: 100%;
                height: 100vh;
                position: fixed;
                top: 0;
                left: 0;
                display: flex;
                justify-content: center;
                align-items: center;
                z-index: 10;
            }

            .Window {
                width: 65vw;
                height: 70vh;
                position: relative;
                transition: height .5s ease-in-out;
                transition: opacity .7s ease-in-out;
            }

            .Cloud {
                position: absolute;
                width: 100%;
                height: 100%;
                z-index: 1;
                transition: all .3s ease-in-out;
            }

