    //Content ---------- ------------ ------------------
    .PortfolioContent {
        width: 100%;
        position: absolute;
        padding: 0 10%;
        z-index: 20;
    }

    .PortfolioInner {
        width: 100%;
        height: 100%;
    }



    /* -- Title ------------------------ */
        .PortfolioTitle {
            margin-top: 100px;
            font-size: 130px;
            display: inline-block;
            transition: opacity;
        }


            @media screen and (max-width: 1260px){
                .PortfolioTitle {
                font-size: 90px;
                }
            }

            @media screen and (max-width: 500px){
                .PortfolioTitle {
                    font-size: 50px;
                }
            }


    /* -- Context ------------------------ */
        .PortfolioContext {
            width: 75vw;
            max-width: 1400px;
            margin-top: 70px;
            display: flex;
            justify-content: space-between;
            transition: opacity;
        }

            .PortfolioContext-Title {
                white-space: nowrap;
                width: 500px;
                font-size: 17px;
            }

            .PortfolioContext-Wrap {
                width: 600px;
            }

            .PortfolioContext-Text {
                font-size: 17px;
                line-height: 28px;
                color: rgb(167, 167, 167);
            }
                #PortfolioContext-Text2 {
                    color: #E6E6E6;
                }

        @media screen and (max-width: 800px) {
            .PortfolioContext {
                flex-direction: column;
            }
            .PortfolioContext-Title {
                width: 100%;
                margin-bottom: 20px;
                font-size: 14px;
            }
            .PortfolioContext-Wrap {
                width: 100%;
            }
            .PortfolioContext-Text {
                font-size: 14px;
            }

        }

        /* -- Project Links ------------------------ */
            .PortfolioProjects {
                margin-top: 250px;
                transition: margin-top .5s ease-in-out;
            }
            .PortfolioProjectsTitle {
                font-size: 10px;
                font-weight: 200;
                text-transform: uppercase;
                margin-bottom: 20px;
                transition: opacity;
            }

            .ProjectList {

            }

            .Project {
                margin-bottom: 50px;
                position: relative;
                transition: opacity;
            }

            .ProjectNumber {
                position: absolute;
                font-size: 13px;
                font-weight: 400;
                margin-top: 5px;
                color: rgb(167, 167, 167);
                transition: margin-top .5s ease-in-out;
            }

            .ProjectLink {
                font-size: 150px;
                font-family: aktiv-grotesk-condensed, sans-serif;
                font-weight: 900;
                font-style: normal;
                text-transform: uppercase;
                outline: none;
                color: rgb(240, 240, 240);
                opacity: 1;
                white-space: nowrap;
                transition: transform opacity 2s ease-in-out;

            }
                    .ProjectLink:hover {
                        opacity: .5;
                    }


            .ProjectDescription {
                font-size: 13px;
                text-transform: uppercase;
                margin-top: -10px;
                margin-left: 5px;
                color: rgb(167, 167, 167);
            }



@media screen and (max-width: 1732px){
