        /* -- Connect ------------------------ */
            .PortfolioConnect {
                margin-top: 140px;
                margin-bottom: 280px;
            }

                .PortfolioConnect-TextBox {
                    width: 600px;
                    display: flex;
                    justify-content: space-between;
                }

                .PortfolioConnect-Email {
                    font-size: 14px;
                    font-weight: 200;
                }

                .PortfolioConnect-SocialWrap {
                    width: 300px;
                    display: flex;
                    justify-content: space-between;
                }

                .SocialTag {
                    font-size: 14px;
                    font-weight: 200;
                }
                    .SocialTag:hover {
                        color: #FFF;
                        font-weight: 700;
                    }




            @media screen and (max-width: 780px){
                .PortfolioConnect-TextBox {
                    flex-direction: column;
                }
                .PortfolioConnect-Email {
                    margin-bottom: 30px;
                }
                .PortfolioConnect-SocialWrap {
                    width: 230px;
                }
            }
